async function cSend(text) {
  if (!text) { const i = document.getElementById('c-inp'); text = i?.value; if (i) i.value = ''; }
  if (!text || !text.trim() || chatLoad) return;
  if (!canUseAI()) { chatMsgs.push({role:'user',content:text.trim()}); chatMsgs.push({role:'assistant',content:freeUsed >= FREE_LIMIT ? 'You\'ve used all 3 free queries! Subscribe to ScentWise Premium ($7/month) for 500 AI queries/month.' : 'Please subscribe to ScentWise Premium ($7/month) to use the AI advisor.'}); _ssw('chatMsgs', chatMsgs); r_chat(document.getElementById('page-chat')); return; }
  text = text.trim();
  chatMsgs.push({role:'user',content:text});
  _ssw('chatMsgs', chatMsgs);
  chatLoad = true;
  r_chat(document.getElementById('page-chat'));

  // Build context from local DB
  const ctx = getContext(text);
  const sysWithCtx = 'You are ScentWise AI, the world\'s most knowledgeable fragrance advisor, powered by a database of over 70,000 real perfumes with actual notes, accords, and ratings. You ALWAYS give confident, specific recommendations with real fragrance names, notes, and details. You never say you are under development or that your database is not operational. When users mention something about the site or numbers, respond helpfully. Format recommendations clearly with fragrance name, brand, key notes, and why it matches. Keep responses concise but informative. Never apologize for lacking data — you have one of the largest fragrance databases in the world. ' + (ctx || '');
  const apiMsgs = chatMsgs.map(m => ({role:m.role, content: m.role==='user' && m.content===text ? sysWithCtx + '\n\nUser question: ' + m.content : m.content}));
  
  const reply = await aiCall('chat', {messages: apiMsgs});
  chatMsgs.push({role:'assistant',content:reply});
  _ssw('chatMsgs', chatMsgs);
  chatLoad = false;
  r_chat(document.getElementById('page-chat'));
}

function retryLast() {
  // Remove the last error response and resend the last user message
  if (chatMsgs.length >= 2 && chatMsgs[chatMsgs.length - 1].role === 'assistant') {
    const lastUser = chatMsgs[chatMsgs.length - 2];
    chatMsgs.pop(); // remove error assistant msg
    chatMsgs.pop(); // remove last user msg
    _ssw('chatMsgs', chatMsgs);
    cSend(lastUser.content);
  }
}

